import React from "react";
import HomeElem from "../styledComponents";

const Home = () => {
  return (
    <div>
      <HomeElem>
        <h1>Deep Sleep</h1>
        <button type="button">Start</button>
      </HomeElem>
    </div>
  );
};

export default HomeElem;
